Venue.create!([
  {name: "The Fillmore", address: "1805 Geary Boulevard", city: "San Francisco", state: "CA", zip_code: 94115, url: "http://www.thefillmore.com", latitude: "37.7842566", longitude: "-122.4332961", api_id: 6239, description: "The Fillmore is a 1,200 capacity music venue located on the boundary between Western Addition and Pacific Heights. It features a beautifully ornate interior, crystal chandeliers and sweeping balconies. The venue is famous worldwide for the unique concert posters that decorate the walls.\r\n\r\nThe Fillmore has lived through various incarnations, operating as a dance hall and roller rink in the 1930s and 40s. In the 1950s a local entrepreneur began booking shows, and the venue played host to acts such as James Brown and Tina Turner. \r\n\r\nThe venue was shut in 1989 after being damaged in the Loma Prieta earthquake, and was not re-opened until 1994, with an unnanounced, surprise re-launch show performed by The Smashing Pumpkins. Since then an eclectic variety of artists have taken to the stage. Patrons are welcomed into the venue and can pick up a famous free apple at the entrance. The Fillmore was acquired in 2008 by Live Nation."},
  {name: "St. James Gate", address: "1410 Old County Road", city: "Belmont", state: "CA", zip_code: 94002, url: nil, latitude: "37.5166619", longitude: "-122.270278", api_id: 294243, description: ""},
  {name: "Bottom of the Hill", address: "1233 Seventeenth Street", city: "San Francisco", state: "CA", zip_code: 94107, url: "http://www.bottomofthehill.com", latitude: "37.7650545", longitude: "-122.3963593", api_id: 248, description: "Bottom of the Hill is one of the most prominent music venues in San Fransisco, located at 1233 Seventeenth Street. There is a outdoor patio area, bar, kitchen and a variety of burgers and sandwiches on the menu.  The venue has an intimate 275 person capacity and shows are mostly 21+.\r\n\r\nSince opening its doors in 1991, the venue has welcomed a variety of notable bands to the stage, including: Green Day, Cake, The Strokes and Neutral Milk Hotel. The venue showcases many upcoming and unsigned new talent."},
  {name: "The Warfield", address: "982 Market Street", city: "San Francisco", state: "CA", zip_code: 94102, url: "http://thewarfieldtheatre.com", latitude: "37.7826598", longitude: "-122.4101811", api_id: 949, description: "The Warfield, located on Market Street, is a 2,250 seat live music venue. It is easily accessible via puiblic transport and there is also public and private parking space available nearby. All ages are welcome inside and the bar area is 21 and over.\r\n\r\nThe venue was built in 1922 and was a popular vauderville theatre. Many notable acts have taken up residency at The Warfield, with the Gratefull Dead playing 15 sold out shows in 1980 and Bob Dylan playing a total of 26 show at the venue from 1979-1980. Since then a huge, eclectic range of artists have taken to the stage."},
  {name: "Moe's Alley", address: "1535 Commercial Way", city: "Santa Cruz", state: "CA", zip_code: 95065, url: "http://www.moesalley.com", latitude: "36.9875196", longitude: "-121.9829327", api_id: 58243, description: ""},
  {name: "Yoshi's Jazz Club, Oakland", address: "510 Embarcadero West", city: "Oakland", state: "CA", zip_code: 94607, url: "http://www.yoshis.com/oakland", latitude: "37.7959363", longitude: "-122.2782863", api_id: 28521, description: ""},
  {name: "Brick & Mortar Music Hall", address: "1710 Mission Street", city: "San Francisco", state: "CA", zip_code: 94103, url: "http://www.brickandmortarmusic.com/", latitude: "37.7696946", longitude: "-122.4201614", api_id: 1296241, description: ""},
  {name: "Amnesia", address: "853 Valencia St.", city: "San Francisco", state: "CA", zip_code: 94110, url: nil, latitude: "37.7593212", longitude: "-122.4213616", api_id: 31103, description: ""},
  {name: "City National Civic", address: "135 W San Carlos St", city: "San Jose", state: "CA", zip_code: 95113, url: "http://sanjosetheaters.org", latitude: "37.3306455", longitude: "-121.8895618", api_id: 1044, description: "Formerly known as:\r\n\r\nSan Jose Civic Auditorium\r\n\r\nBuilt in 1934, the San Jose Civic is a Spanish mission-style, dual-level venue that hosts a variety of events including concerts, performing arts, general assembly and special events. Located directly across the street from the San Jose McEnery Convention Center, the Civic features 3,001 seats in concert form. This facility provides additional exhibit and general assembly space in conjunction with the convention center and Parkside Hall."},
  {name: "Hemlock Tavern", address: "1131 Polk St", city: "San Francisco", state: "CA", zip_code: 94109, url: "http://www.hemlocktavern.com", latitude: "37.7873492", longitude: "-122.4199937", api_id: 31153, description: ""},
  {name: "First Unitarian Universalist Center", address: "1187 Franklin Street", city: "San Francisco", state: "CA", zip_code: 94109, url: nil, latitude: "37.78529", longitude: "-122.4232848", api_id: 2040259, description: ""},
  {name: "Bill Graham Civic Auditorium", address: "99 Grove Street", city: "San Francisco", state: "CA", zip_code: 94102, url: "http://www.apeconcerts.com/venue_bgc.cfm", latitude: "37.7785099", longitude: "-122.4174684", api_id: 65, description: ""},
  {name: "Hotel Utah Saloon", address: "500 Fourth Street", city: "San Francisco", state: "CA", zip_code: 94107, url: "http://www.hotelutah.com/", latitude: "37.7795638", longitude: "-122.398023", api_id: 328, description: ""},
  {name: "The Independent", address: "628 Divisadero Street", city: "San Francisco", state: "CA", zip_code: 94117, url: "http://www.theindependentsf.com", latitude: "37.7755211", longitude: "-122.4378099", api_id: 324, description: "San Francisco's 628 Divisadero has lived as various incarnations, showcasing live music over the decades, and is currently The Independent, an intimate music venue in the Alamo Square district. The Independent frequently hosts big name acts accompanied with local supports."},
