  {name: "Toot's Tavern", address: "627 2nd Ave", city: "Crockett", state: "CA", zip_code: 94525, url: "http://www.tootstavern.com", latitude: "38.053431", longitude: "-122.223244", api_id: 624206, description: ""},
  {name: "Feinstein's at Hotel Nikko", address: "222 Mason St.", city: "San Francisco", state: "CA", zip_code: 94102, url: nil, latitude: "37.7860672", longitude: "-122.4092521", api_id: 2511059, description: ""},
  {name: "The Chapel", address: "777 Valencia Street", city: "San Francisco", state: "CA", zip_code: 94110, url: "http://www.thechapelsf.com/", latitude: "37.760565", longitude: "-122.421188", api_id: 2029634, description: "The Chapel is a new music venue and restaurant located in the heart of the Mission District in a 1914 building that was originally built as a mortuary. It has been renovated by veteran Bay Area commercial real estate developer and restaurateur Jack Knowles. The beautiful chapel with its 40-foot high arched ceiling has been converted to a music room with mezzanine, while the rest of the building has been remodeled to hold a restaurant and casual grill with an outdoor dining patio."},
  {name: "Biscuits and Blues", address: "401 Mason Street", city: "San Francisco", state: "CA", zip_code: 94102, url: "http://www.biscuitsandblues.com/", latitude: "37.7873533", longitude: "-122.4100572", api_id: 11497, description: ""},
  {name: "Ruby Skye", address: "420 Mason St", city: "San Francisco", state: "CA", zip_code: 94102, url: "http://www.rubyskye.com/", latitude: "37.7874395", longitude: "-122.4098178", api_id: 331, description: ""},
  {name: "Slim's", address: "333 11th Street", city: "San Francisco", state: "CA", zip_code: 94103, url: "http://www.slims-sf.com", latitude: "37.7715171", longitude: "-122.413259", api_id: 1489, description: "Slim's is a 500 capacity music venue located at 333 11th Street, a 'sister club' to The Great American Music Hall. The atmospheric space is lit by candlesticks on the walls, also featuring hanging chandeliers with brick walls and a modest rear balcony. \r\n\r\nFood is available at all shows, with a selection of burgers and Nachos on the menu. Photographic policy depends on the policy of the artist playing. Slim's is wheelchair accessible. Slim's has welcomed an eclectic mix of artists to its stage, from Nirvana to Red Hot Chili Peppers."},
  {name: "Ivy Room", address: "860 San Pablo Ave.", city: "Albany", state: "CA", zip_code: 94706, url: nil, latitude: "37.890405", longitude: "-122.2993057", api_id: 2905253, description: ""},
  {name: "Don Quixote's International Music Hall", address: "6275 Highway 9", city: "Felton", state: "CA", zip_code: 95018, url: "http://www.donquixotesmusic.info/", latitude: "37.0526301", longitude: "-122.0734163", api_id: 13674, description: ""},
  {name: "Rickshaw Stop", address: "155 Fell Street", city: "San Francisco", state: "CA", zip_code: 94102, url: "http://www.rickshawstop.com", latitude: "37.7759644", longitude: "-122.4204165", api_id: 14791, description: "Rickshaw Stop is a music venue, bar and restaurant located at 155 Fell St. in Hayes Valley. San Francisco. There is a 127 person capacity. Street parking and coat check are available. Rickshaw Stop was formerly a TV studio but now welcomes local and touring acts to the intimate stage. The interior is furnished with red curtains and vintage rickshaws, housed under high ceiling, with an upstairs bar."},
  {name: "The Fireside Lounge", address: "1453 Webster St", city: "Alameda", state: "CA", zip_code: 94501, url: nil, latitude: "37.7729966", longitude: "-122.2767805", api_id: 31511, description: ""},
