  {name: "Monarch", address: "101 6th St", city: "San Francisco", state: "CA", zip_code: 94103, url: "http://www.monarchsf.com", latitude: "37.7809924", longitude: "-122.4085148", api_id: 1595753, description: ""},
  {name: "Doc's Lab", address: "124 Columbus Ave", city: "San Francisco", state: "CA", zip_code: 94111, url: "http://www.docslabsf.com/calendar/", latitude: "37.7967858", longitude: "-122.4048005", api_id: 2745703, description: ""},
  {name: "The New Parish", address: "579 18th Street", city: "Oakland", state: "CA", zip_code: 94612, url: "http://www.thenewparish.com/", latitude: "37.8079502", longitude: "-122.2728094", api_id: 523156, description: ""},
  {name: "San Francisco Community Music Center", address: "544 Capp St.", city: "San Francisco", state: "CA", zip_code: 94110, url: "http://www.sfcmc.org", latitude: "37.757921", longitude: "-122.418205", api_id: 32046, description: ""},
  {name: "Neck of the Woods", address: "406 Clement Street", city: "San Francisco", state: "CA", zip_code: 94118, url: "http://neckofthewoodssf.com/", latitude: "37.7831143", longitude: "-122.4637331", api_id: 2091824, description: "Neck of the Woods is one of San Francisco’s premier new music venue and nightclub.  We strive to showcase the best local and national musical acts with two floors, two stages, and 6500 square feet of event space. \r\n\r\nDownstairs boasts lounge seating, full stage with a top notch sound system, flat screen TVs, a projector screen, board games, free wifi, and the friendliest bartenders in the city.  Come and join us for happy hours with $3 beers, all while enjoying our daily festivities.\r\n\r\nIf you’re here for the show, upstairs is where you want to be. Neck of the Woods has one of the best sound systems in the city that will definitely get you moving. A nice stage with a giant dance floor, VIP section overlooking Clement Street, lounge with tables, and two fully stocked bars are only a taste of what the venue offers. Great entertainment and good company is exactly what you’ll find upstairs.\r\n\r\nNeck of the Woods has something for everyone.  Great amenities and top notch musical acts, we are striving to be the new venue for alternative rock, indie rock, dance pop, and electronic artists in the Richmond District of San Francisco.\r\n\r\nNeck of the Woods takes pride in having the best sound system as well as having the friendliest bartenders in the city. Great entertainment and good company is exactly what you’ll find here.\r\n\r\nNeck of the Woods is constantly searching for new talent and upcoming artists to play at our venue.  With our experienced staff, we can assist you with production and event planning. Please contact us."},
  {name: "Winter's Tavern", address: "1522 Francisco Blvd", city: "Pacifica", state: "CA", zip_code: 94044, url: nil, latitude: "37.6366327", longitude: "-122.4904325", api_id: 1540323, description: ""},
  {name: "Press Club Wine Bar and Lounge", address: "20 Yerba Buena Ln.", city: "San Francisco", state: "CA", zip_code: 94103, url: "http://www.pressclubsf.com", latitude: "37.7859785", longitude: "-122.4045719", api_id: 1070076, description: "A San Francisco Wine Bar and Lounge\r\n\r\nPress Club, a wine bar and lounge, offers California’s finest wines and beers in a sophisticated, social atmosphere. Press Club's menu of seasonal small plates and thoughtful pairings offers the ultimate wine experience in one of San Francisco's most notable destinations. Visitors can socialize, taste wine and share small plates in the luxurious wine tasting cellar at the foot of the Four Seasons Hotel.\r\n\r\nThis San Francisco wine bar, located two blocks from both Union Square and the Moscone Convention Center, is the most authentic wine tasting venue in San Francisco. Each month an artisan vintner is featured at Press Club. Visitors can try wines directly from the winemaker on select evenings, which are posted on the events calendar on our website.\r\n\r\nPress Club's award-winning architecture makes it a perfect place for wine tasting receptions, corporate events, private parties, wedding receptions and more. See the Events section of our website for more info, or to submit an event inquiry.\r\n\r\nwww.pressclubsf.com"},
  {name: "Starline Social Club", address: "645 West Grand Avenue", city: "Oakland", state: "CA", zip_code: 94612, url: "http://www.starlinesocialclub.com/", latitude: "37.8122828", longitude: "-122.2725291", api_id: 1522398, description: ""},
  {name: "Sf Jazz", address: "2174 Market Street", city: "San Francisco", state: "CA", zip_code: 94114, url: nil, latitude: "37.7664002", longitude: "-122.4304782", api_id: 814546, description: ""},
  {name: "Temple", address: "540 Howard st", city: "San Francisco", state: "CA", zip_code: 94105, url: "http://www.templesf.com", latitude: "37.7878084", longitude: "-122.397191", api_id: 32793, description: ""},
  {name: "Sweetwater Music Hall", address: "19 Corte Madera Avenue", city: "Mill Valley", state: "CA", zip_code: 94941, url: "http://www.sweetwatermusichall.com/", latitude: "37.9070173", longitude: "-122.5479375", api_id: 1633868, description: "The Sweetwater opened in 1972 in a rustic, downtown Mill Valley storefront previously occupied by a local watering hole called the Office.  On its opening night, the Sweetwater presented an acoustic folk‐rock group that played for a crowd that lined up halfway down the block to get in.  While the Sweetwater enjoyed a most auspicious beginning, it wasn’t until a decade later that the tiny 90-seat tavern with a stage earned its rightful place in music history."},
  {name: "Mezzanine", address: "444 Jessie Street", city: "San Francisco", state: "CA", zip_code: 94103, url: "http://www.mezzaninesf.com/", latitude: "37.7823916", longitude: "-122.4080206", api_id: 329, description: "Mezzanine is a 1000 person capacity on 444 Jessie Street, San Fransisco. There are multiple bars within the venue as well as a photo booth and an upstairs area with table service. Coat check is available and there is an outdoor patio for smokers. The venue is close to Powell St BART Station."}
